import React,{useState} from 'react';
import './index.css';

function Login() {

   const [counter, setCounter] = useState(0)

   const increase = () => {
      setCounter(prev => prev + 1);
   }

    const logins = [
        {username: "testing", password: "pass123"},
     ];
  return (
    <div>
      <h1>{counter}</h1>
      <button onClick={increase}>Click</button>
       </div>
  );
}

export default Login;
